import 'package:piix_mobile/general_app_feature/data/repository/file_system_repository_deprecated.dart';
import 'package:piix_mobile/file_feature/domain/model/request_file_model.dart';
import 'package:piix_mobile/file_feature/domain/model/s3_file_model.dart';

@Deprecated('Will be removed in 4.0')
extension FileSystemRepositoryAppUseTestDeprecated on FileSystemRepositoryDeprecated {
  Future<dynamic> getFileFromPathRequestedTest(
      RequestFileModel requestFileModel) async {
    final seconds = requestFileModel.propertyName
                ?.compareTo('cbb3c0b45ccf0871d8bf101c1/cardImage') ==
            0
        ? 2
        : 4;
    return Future.delayed(Duration(seconds: seconds), () {
      if (requestFileModel.propertyName?.contains('error') ?? false) {
        return FileStateDeprecated.error;
      } else if (requestFileModel.propertyName?.contains('found') ?? false) {
        return FileStateDeprecated.notFound;
      }
      return fakeJsonFile(requestFileModel.propertyName ?? '');
    });
  }

  Future<FileStateDeprecated> uploadS3FileRequestedTest(
      S3FileModel s3FileModel) async {
    return Future.delayed(const Duration(seconds: 2), () {
      if (s3FileModel.fileContentType.contains('error')) {
        return FileStateDeprecated.error;
      } else if (s3FileModel.fileContentType.contains('upload')) {
        return FileStateDeprecated.uploadError;
      }
      return FileStateDeprecated.uploaded;
    });
  }

  Map<String, dynamic> fakeJsonFile(String propertyName) {
    if (propertyName.compareTo('cbb3c0b45ccf0871d8bf101c1/cardImage') == 0) {
      return <String, dynamic>{
        'fileContent': {
          'name': 'cbb3c0b45ccf0871d8bf101c1/cardImage',
          'contentType': 'image/png',
          //TODO: Get real image base64 content image
          'base64Content':
              '',
        },
        'state': FileStateDeprecated.retrieved,
      };
    }
    return <String, dynamic>{
      'fileContent': {
        'name': 'cbb3c0b45ccf0871d8bf101c2/cardImage',
        'contentType': 'image/png',
        //TODO: Get real image base64 content image
        'base64Content':
            '',
      },
      'state': FileStateDeprecated.retrieved,
    };
  }
}
